import React from 'react';
const AddTodo = () => {
    return (
        <form>
            <div className="title">
                <label htmlFor="title">Add Title</label>
                <input type="text" className="input" placeholder="Add A Title" name="title" id="title"/>
            </div>
            <div className="title">
                <label htmlFor="title">Add Description</label>
                <input type="text" className="input" placeholder="Add A Description" name="desc" id="desc"/>
            </div>
            <button type="submit">Add Todo</button>
        </form>
    )
}
 
export default AddTodo;
